INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0, "春咲 ひより", "お！\nあそこに困ってそうな人発見！", 1, 0, 0, 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0, "草野 優衣", "大切な人を\n守れるようになりたい…って", 1, 0, 0, 1002, "みんなみたいに\nわたしも強くならなきゃ", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "少しは磨かれると思いますよ。", 1, 0, "士条 怜", "キミに必要な集中力と感性が", 1, 0, 0, 1003, "フェンシングを始めてみては？", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0, "穂高 みそぎ", "今日はなにして遊ぶ？", 1, 0, 0, 1004, "ねぇ、にいちゃん！", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "私といっしょに…\nいかない？", 1, 0, "風宮 あかり", "ねぇ…", 1, 0, 0, 1006, "風宮あかりです", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "食べ物の恨みは怖いのー", 1, 0, "出雲 宮子", "プリンたべたいのー", 1, 0, 0, 1007, "出雲宮子なのー", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "いいよ。\n見られることは運命さ…", 1, 0, "虹村 雪", "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0, 0, 1008, "ボクは虹村雪。", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "人呼んで「疾風の冥姫」!!", 1, 0, "柊杏奈", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0, 0, 1009, "フッ…聞いて後悔するがいい！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ほんまおおきにやわ～♪", 1, 0, "姫宮 真歩", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0, 0, 1010, "マホマホ王国のプリンセス、\nまほ姫どす", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ここで会ったが\n100年目～！", 1, 0, "衣之咲 璃乃", "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0, 0, 1011, "衣之咲璃乃です！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "…って、お願い！\n誰にも言わないでおいて～！", 1, 0, "柏崎 初音", "ち、超能力って…\n何のことかな～？", 1, 0, 0, 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0, "美波 鈴奈", "一応カリスマ読モJKやってまっす！", 1, 0, 0, 1016, "ちょす！\n美波鈴奈だよ～♪", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "でも、沖縄もとってもいいとこさー", 1, 0, "喜屋武 香織", "東京は遊園地みたいなところさー", 1, 0, 0, 1017, "はいたーい。\n喜屋武香織さー。", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "イオちゃんって呼んでね。", 1, 0, "支倉 伊緒", "先生って呼ばれるのは\nくすぐったいから", 1, 0, 0, 1018, "支倉伊緒です。", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ミミをおいてかないでぇ～", 1, 0, "茜 ミミ", "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0, 0, 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ふぇぇぇぇぇん……", 1, 0, "栗林 くるみ", "あの……\nふぇ……", 1, 0, 0, 1021, "あ…あの…えっと…\n栗…林…くるみ…です……", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "なんてありがとうございます！", 1, 0, "風宮 より", "こんな私に貴重な時間を\n割いていただき、", 1, 0, 0, 1022, "風宮よりです。\nあああああ！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "私こっち行きたいー\nね、早く早くー", 1, 0, "北条 綾音", "おにいちゃんどこいくの？\nえ？", 1, 0, 0, 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "これて何か違う…\nあああすみません！", 1, 0, "天野 すずめ", "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0, 0, 1025, "わっ…わっ…私、\n天野すずめといいます！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "離しませんわ………\n絶対に…!!", 1, 0, "倉石 恵理子", "あなたは…運命の……\n伴侶……", 1, 0, 0, 1027, "……クスクス…私は\n…倉石恵理子……", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "…そうでしょ？？", 1, 0, "佐々木 咲恋", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0, 0, 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "あはは、\n私もまだまだだなぁ～", 1, 0, "桜井 望", "ぇっと…\nキミ、私のこと知らないの?!", 1, 0, 0, 1029, "桜井望だよ！\nよろしくねっ", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0, "ニノン・ジュベール", "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0, 0, 1030, "デケデケデンっ！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "おかしいですね……", 1, 0, "上喜 しのぶ", "でもって私の隣にいるのが……\nえ、見えない？", 1, 0, 0, 1031, "上喜しのぶです。\n手元のドクロが父です。", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "そう、\nオラのボケに突っ込める相方が…！", 1, 0, "野戸まひる", "けんども\nそれには足りないモンが…", 1, 0, 0, 1033, "目指すはビッグな\nお笑い芸人だっぺ！", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ちょ\nちょっと一杯飲んできます…！", 1, 0, "綾瀬 ゆかり", "ちょっと緊張しちゃって…", 1, 0, 0, 1034, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "これ以上お話しすることは…\nないです！", 1, 0, "氷川 鏡華", "知らない人とは話しちゃいけないので", 1, 0, 0, 1036, "氷川鏡華…です", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0, "柏崎 栞", "……あ、アラーム。", 1, 0, 0, 1038, "柏崎…栞です。", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "野に咲く花が、\n唯一の話相手です。", 1, 0, "双葉 碧", "私、一人も友達がいなくて……", 1, 0, 0, 1040, "ふ、双葉碧です。", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "そう思っています。", 1, 0, "三角 千歌", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0, 0, 1042, "三角千歌です。", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "う、疑ってすまなかったな…", 1, 0, "安芸 真琴", "あぁ？\nお前のそいつの仲間か？", 1, 0, 0, 1043, "安芸真琴だ。", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0, "イリヤ・オーンスタイン", "生けとし生ける全ての者よ！", 1, 0, 0, 1044, "わらわこそは夜を総べる者！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "ｌク、クウカに何かご用ですか!?", 1, 0, "遠見 空花", "ぐふふふふ……はっ！", 1, 0, 0, 1045, "そこで騎士は妖精を乱暴に……", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0, "宮坂たまき", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0, 0, 1046, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0, "大神 美冬", "それでは早速クエストに…", 1, 0, 0, 1048, "大神美冬よ！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0, "星野静流", "クエストもバトルも\n掃除も洗濯も", 1, 0, 0, 1049, "星野静流だよ！", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 0, "玉泉美咲", "見ての通りの\nセクシー美少女で", 1, 0, 0, 1050, "アタシは玉泉美咲。", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "？？？？", 1, 0, "リマ", "？？？？", 1, 0, 0, 1052, "？？？", 2, 0, 1.4, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "そ、そこまでいうなら\nもらってやる", 1, 0, "モニカ・ヴァイスヴィント", "菓子でつろうなどと\n稚拙な策を……", 1, 0, 0, 1053, "モニカ・ヴァイスヴィントだ。", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "そ、そこまでいうなら\nもらってやる", 1, 0, "ペコリーヌ", "菓子でつろうなどと\n稚拙な策を……", 1, 0, 0, 1058, "モニカ・ヴァイスヴィントだ。", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "そ、そこまでいうなら\nもらってやる", 1, 0, "コッコロ", "菓子でつろうなどと\n稚拙な策を……", 1, 0, 0, 1059, "モニカ・ヴァイスヴィントだ。", 2, 0, 1.5, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, "そ、そこまでいうなら\nもらってやる", 1, 0, "キャル", "菓子でつろうなどと\n稚拙な策を……", 1, 0, 0, 1060, "モニカ・ヴァイスヴィントだ。", 2, 0, 1.5, 0);
